import React from "react";
import "./App.css";
import { HomePage } from "./pages";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route path="/" component={HomePage} />
        </Switch>
        <HomePage />
      </div>
    </Router>
  );
};

export default App;
